import React from "react";
import Svg from "../Svg";
import { SvgProps } from "../types";

interface LogoProps extends SvgProps {
  isDark: boolean;
}

const Logo: React.FC<React.PropsWithChildren<LogoProps>> = ({ isDark, ...props }) => {
  const textColor = isDark ? "#FFFFFF" : "#000000";
  return (
    <Svg viewBox="0 0 915 256" {...props}>
      <svg version="1.2" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 915 256" width="915" height="256">
      <defs>
        <image  width="915" height="256" id="textlogo" href="data:image/png;base64,"/>
      </defs>
      <use id="Background" href="#textlogo" x="0" y="0"/>
      </svg>
    </Svg>
  );
};

export default React.memo(Logo, (prev, next) => prev.isDark === next.isDark);
